import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import './component.css';
import { connect } from 'react-redux';
import '../styles/navbar.css';
import ResponsiveMenu from 'react-responsive-navbar';
import LoggedInNavbar from './loggedinnavbar';
import LoggedOutNavbar from './loggedoutnavbar';
import firebase from '../config/firebaseconfig';
import "./component.css";


import { Nav, Navbar } from 'react-bootstrap';



class NavBar extends Component {


  render() {

    const { auth, profile } = this.props;

    return (
      <div style={{position: "relative"}}>
      <Navbar className="Navbar" /*style={!auth.uid ? { marginRight : "600px" } : null}*/>
        <Navbar.Brand variant="light" href='/'>Salon</Navbar.Brand>
        <Nav>
          <div className="form-inline">
          <Nav.Link variant="light" href='/livestreaming'>Live Streaming</Nav.Link>
          <Nav.Link href='/buddies'>Buddies</Nav.Link>
          {auth.uid ? <LoggedInNavbar /> : null}
          </div>
        </Nav>
        </Navbar>
        {!auth.uid ? <LoggedOutNavbar /> : null}
      </div>
      /*
      <ResponsiveMenu

        menuOpenButton={<div />}
        menuCloseButton={<div />}
        changeMenuOn="500px"
        largeMenuClassName="large-menu-classname"
        smallMenuClassName="small-menu-classname"
        menu={
          <ul>
            <li><Link to='/home'>Home</Link></li>
            <li><Link to='/streamingplaza'>Streaming Plaza</Link></li>
            <li><Link to='/waitingroom'>Waiting Room</Link></li>
            <li ><Link to='/profile'>My Profile</Link></li>
            {auth.uid ? <img src={firebase.storage().ref(`images/`+auth.uid).getDownloadURL()} /> : <LoggedOutNavbar />}
          </ul>
        }
      />
      */
    );
  }
}

const mapStateToProps = (state) => {
  return {
      auth: state.firebase.auth,
      profile: state.firebase.profile
  }
}

export default connect(
  mapStateToProps
)(NavBar);


